import React, { useState } from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom'
import Users from './user/pages/Users';
import './App.css'

const App = () => {
  return <Router>
    <Route path="/users">
      <Users/>
    </Route>
  </Router>
}

export default App;
